TITLE:
  - shear flow with moving circular embedded fluid
PROBLEM TYPE:
  PROBLEMTYPE: "Fluid_Ale"
IO:
  FILESTEPS: 1
FLUID DYNAMIC:
  LINEAR_SOLVER: 1
  NONLINITER: Newton
  INITIALFIELD: "field_by_function"
  RESTARTEVERY: 5
  NUMSTASTEPS: 1
  STARTFUNCNO: 2
  TIMESTEP: 1
